import { Container, Row, Col } from "react-bootstrap";

const Tabs = () => {
  return (
    <Container>
      <Row>
        <Col>
          <div>
            <h2>Wnioski do pobrania</h2>
          </div>
        </Col>
        <Col>
          <div>
            <h2>Interaktywne formularze</h2>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Tabs;
